import axios from 'axios';

export const token = async (loginType:string) => {
    console.log('siamo qui')
    const url= 'http://localhost:8080/oauth2/authorization/'+loginType
    console.log(url)
    const loginData= await axios.get(url).then((response)=>{
        console.log(response)})
}
